import React from 'react';

const RenderReviews = (props) => {
    let mappedReviews = props.perfume.reviews.map(review => {
      return (
        <p key={review.id}>{review.name}</p>
      )
     }
    )

    return (
      <div>
        <h1>Reviews</h1>
        <div>{mappedReviews}</div>
      </div>
    )
}

export default RenderReviews;
